import React from "react";

function History(props) {
  function viewResults(result) {
      console.log(result);
    return (
      <>
        <div>{result}</div>
      </>
    );
    // props.historyfunc(result);
  }
  return (
    <div>
      <ul>
        {props.history.map((item, index) => {
          return (
            <li
              key={index}
              onClick={() => {
                viewResults(item.result);
              }}
            >
              {item.method} {item.url}
            </li>
          );
        })}
      </ul>
    </div>
  );
}
export default History;
